const GET_NAME = 'GET_NAME'

export const loadCategoryNameAction = payload => ({type: GET_NAME, payload})

export const category_name_reducer = (state = [], action) => {
    if(action.type === GET_NAME) {
        return action.payload
    }
    else return state
}
